现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "(1) panel_results": [
    {
      "mutation": "[字符串]",
      "binding_importance": "[数值]",
      "effect_score_A": "[数值]",
      "impact_score_B": "[数值]",
      "predicted_impact_B": "[字符串]",
      "volume_change_B": "[数值]",
      "hydrophobicity_change_B": "[数值]",
      "charge_change_B": "[数值]",
      "h_bond_change_B": "[数值]"
    }
  ],
  "(2) ranked_list": "[8个字符串的数组]",
  "(3) consistency_report": {
    "overlap_mutations": [
      {
        "mutation": "[字符串]",
        "category_A": "[字符串]",
        "category_B": "[字符串]",
        "numeric_diff": "[数值]",
        "match": "[布尔值]"
      }
    ],
    "classification_thresholds": {
      "severe": "[字符串]",
      "mild": "[字符串]",
      "minimal": "[字符串]"
    },
    "agreement_rate": "[数值]",
    "agreement_threshold": "[数值]",
    "status": "[字符串]",
    "notes": "[字符串]"
  },
  "(4) consensus_top_hit": {
    "mutation": "[字符串]",
    "ranking_position": "[数值]",
    "predicted_impact_B": "[字符串]",
    "volume_change_B": "[数值]",
    "justification": "[字符串]"
  },
  "(5) negative_control": {
    "mutation": "[字符串]",
    "predicted_impact_B": "[字符串]",
    "reason": "[字符串]"
  }
}
